class Solution {
public:
    int subarraySum(vector<int>& nums, int k) {
        int sum=0,count=0;
        unordered_map<int,int> mp;
        mp[sum]=1;
        for(int &i:nums)
        {
            sum+=i;
            if(mp[sum-k]>0)
            count+=mp[sum-k];
            mp[sum]++;
        }
        return count++;
    }
};
